import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navigation from './Navigation';
import Home from './Home'; // Create this component
import About from './About'; // Create this component
import Activities from './Activities'; // Create this component
import Team from './Team'; // Create this component
import ConuAI from './ConuAI'; // Create this component
import CallToActionCard1Page from './CallToActionCard1Page'; // Import the new page

function MyMain() {
    return (
        <Router>
            <Navigation />
            <Switch>
                <Route path="/" exact component={Home} />
                <Route path="/about" component={About} />
                <Route path="/activities" component={Activities} />
                <Route path="/team" component={Team} />
                <Route path="/conuai" component={ConuAI} />
                <Route path="/call-to-action" component={CallToActionCard1Page} />
            </Switch>
        </Router>
    );
}

export default MyMain;
